// src/components/Header.js
import React from 'react';
import './Header.css';

function Header({ setActiveSection }) {
  return (
    <header className="Header">
      {/* <h1>Uma Bisht</h1> */}
      <nav>
        <ul>
          <div className='b1'><li onClick={() => setActiveSection('Home')}>Home</li></div>
          <div className='b1'><li onClick={() => setActiveSection('Projects')}>Projects</li></div>
          <div className='b1'><li onClick={() => setActiveSection('Education')}>Education</li></div>
          <div className='b1'><li onClick={() => setActiveSection('Skills')}>Skills</li></div>
          <div className='b1'><li onClick={() => setActiveSection('Achievements')}>Achievements</li></div>
          <div className='b1'><li onClick={() => setActiveSection('Contact')}>Achievements</li></div>
          {/* <li onClick={() => setActiveSection('Certifications')}>Certifications</li> */}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
